		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Knastakslens rolle er at kontrollere åbning og lukning af ventilen. I det variable ventiltimingssystem ændrer den elektroniske knastakselreguleringsventil (eller oliekontrolventil, OCV) Vinklen på knastakslen justeres ved hjælp af olietryk til knastakseljusteringen (mekanisk type) for at sikre at ventilen åbner og lukker på det optimale tidspunkt Fejlårsagerne til P0021 inkluderer A indsugnings/venstre/forreste knastaksel timing ikke indstillet Det er fast, knastakslen sidder mekanisk fast , eller aktuatorventilen sidder fast i åben position."
