		"zs": "Olietemperaturføleren (EOT) sender olietemperaturen til den elektroniske styreenhed (ECU) i form af et elektrisk signal efter termistorens princip. Hvis den elektroniske styreenhed (ECU) registrerer, at olietemperaturfølerens signalspænding er i. Fortsat over den kalibrerede maksimumgrænse (lav temperatur) i et bestemt tidsrum, vil denne DTC fremkomme. Årsager til fejl omfatter olietemperaturføleren, dens kredsløb eller stikket."
