		"dm": "P0017",
		"des": "Krumtapakselposition - Knastakselpositionskorrelation (bank 1, sensor B)",
		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Krumtapakslens rolle er at vende stemplets op- og nedadgående bevægelse til en roterende bevægelse. Knastakslens rolle er at styre åbning og lukning af ventilerne. Den elektroniske styreenhed (ECU) kontinuerligt overvåger den variable knastaksels timingposition, Kontroller den relative position mellem knastakslen og krumtapakslen. Hvis den relative position er forkert justeret med mere end 1 tand, vil denne fejlkode fremkomme. Årsagerne til fejlen omfatter selve knastakselpositionssensoren eller dens kredsløbsfejl, og selve krumtapakselpositionssensoren eller dens kredsløbsfejl, motorhastighedssensorfejl, forurenet olie, variabel knastakselmagnetventil sidder fast osv."
