		"zs": "Udstødningstrykreguleringsventilen er en ventil med variabel position. Dens hovedfunktion er at hjælpe motoren med at varme op hurtigt ved at ændre udstødningstrykket (forøget motorbelastning), når udetemperaturen er ekstremt lav (<5 grader Celsius) .Denne fejlkode angiver, at udstødningstrykreguleringsventilen A sidder fast i lukket position."
