		"des": "Turbolader/superlader Boost Control B-position overskredet indlæringsgrænsen",
		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Turboladeren bruger inertimomentumet af udstødningsgassen, der udledes fra motoren, til at drive turbinen, som igen driver koaksialhjulet for at sætte tryk på indsugningsluften og derved øge bilens kraft. Kompressoren er en kompressor. bruges til at øge forbrændingsmotorens effekt Luftkompressor til indsugningsluft Mere indsugningsluft giver mere ilt til motoren, hvilket gør det muligt for kontrolmodulet at give mere brændstof, hvilket øger effektydelsen Turbo/supercharger boostens rolle controller er, når Efter at ladetrykket når den indstillede værdi, skubber lufttrykket wastegate-aktuatoren (pneumatisk mekanisk) for at omgå noget af udstødningsgassen fra turboen, hvorved turbohastigheden reduceres og boostniveauet kontrolleres. Denne fejlkode angiver, at turbo/superlader boost-kontrol Position B er uden for det normale område."
