		"sys": "Tændingssystem",
		"zs": "Krumtapakslens funktion er at vende stemplets op- og nedadgående bevægelse til en rotationsbevægelse. Krumtapakselpositionssensoren (CKP) (også kaldet den øverste dødpunktssensor) bruges til at detektere det øverste dødpunkt (TDC)-signal og krumtapaksel-vinkelsignalet Og motorhastighedssignalet, og indlæs det i computeren, så computeren kan afgive den bedste tændingstidskommando i henhold til cylindrenes affyringssekvens. Hvis den elektroniske styreenhed (ECU) registrerer en fejl i spændingen i krumtapakselsensor A-kredsløbet, vil denne fejlkode fremkomme."
