		"zs": "Den kørende anti-udskridningskontrol (TCS)-systemets funktion er at styre drejningsmomentet ved at forsinke tændingstiden osv., når drivhjulsglidningen registreres, opskift på forhånd, startende i andet gear , forhindrer momentomformeren Låse og bremser osv. for at forhindre glidning."
