	"P0443": {
		"zzs": "Alle bilproducenter",
		"dm": "P0443",
		"des": "Fordampningsemissionssystem rensekontrolventilkredsløb",
		"sys": "Emissionskontrol",
		"zs": "EVAP-systemet (Evaporative Emission) leder benzindampe fra brændstoftanken ind i en lagertank, der indeholder aktivt kul, der absorberer benzindampe. Motoren bruger derefter frisk luft til at rense disse benzindampe ind i motorens forbrændingskammer. Hvis hvornår den elektroniske kontrolenhed (ECU) detekterer, at spændingen for udluftningsmagnetventilens styrekredsløb for fordampningsemissionssystemet overstiger det normale kalibreringsområde, fejlkoden vises. Fejlårsagerne omfatter udrensningsaktuatorkredsløbsfejl i fordampningsemissionssystemet, fejl i udluftningskontrolventil, elektronisk kontrol modul (PCM eller ECM) fejl osv."
	},
