		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Turboladeren bruger inertimomentumet af udstødningsgassen, der udledes fra motoren, til at drive turbinen, som igen driver koaksialhjulet for at sætte tryk på indsugningsluften og derved øge bilens kraft. Kompressoren er en kompressor. bruges til at øge forbrændingsmotorens effekt. Indsugningsluftkompressor. Mere indsugningsluft giver mere ilt til motoren, hvilket gør det muligt for kontrolmodulet at give mere brændstof og derved øge udgangseffekten. Supercharger-omløbsventilens rolle er, når ladetrykket overstiger Når det er stort, åbnes bypass-ventilen for at frigive en del af højtryksluften, for at opnå formålet med at beskytte superladeren og motoren. Denne fejlkode angiver, at spændingen på turbo/supercharger-bypass-ventilen styrekredsløbet overstiger det normale kalibreringsområde."
