		"zs": "Liltsensorens funktion er at måle iltindholdet i motorens udstødningsgas for at korrigere brændstofindsprøjtningsmængden, så motoren kan opnå det bedste luft-brændstofforhold. I OBD-fejlkoden, du vil ofte se antallet af rækker og tal Iltsensor. Række 1 refererer til rækken hvor cylinder 1 er placeret, og den resterende række er række 2. Uanset hvilken række, refererer den første sensor altid til opstrøms iltsensoren (før katalysatorbeholderen), Den 2. føler refererer altid til den nedstrøms iltføler (efter katalysatorbeholderen).Denne fejlkode vil fremkomme, når spændingen af det opvarmede iltfølersignal fortsætter med at være højere end 1,5 volt i en bestemt periode. Årsagen til fejlen omfatter iltsensorsignalet. Kredsløbet er kortsluttet til positivt, selve iltsensoren er defekt, det elektroniske styremodul (PCM eller ECM) er defekt osv."
