		"zs": "Turboladeren bruger inertimomentum af udstødningsgassen, der udledes fra motoren, til at drive turbinen, som igen driver koaksialhjulet til at sætte tryk på indsugningsluften og derved øge bilens effekt. Ladeluftkøleren ( også kaldet intercooler) ) bruges til at køle den overladede luft fra superchargeren. Efter at luften er passeret gennem superchargeren, stiger trykket, og temperaturen stiger. Den overladede lufttemperatur kan reduceres af supercharger-luftkøleren og derved øge luften tæthed og forøgelse af opladningseffektiviteten for at øge motoreffekten og reducere emissioner. Hvis ladeluftkølerens kølevæskepumpestyrekredsløbsspænding falder under den kalibrerede minimumværdi, vises denne fejlkode."
