		"sys": "Brændstof eller luft",
		"zs": "Liltsensorens funktion er at måle iltindholdet i motorens udstødningsgas for at korrigere brændstofindsprøjtningsmængden, så motoren kan opnå det bedste luft-brændstofforhold. I OBD-fejlkoden, du vil ofte se antallet af rækker og tal Iltsensor. Række 1 refererer til rækken hvor cylinder 1 er placeret, og den resterende række er række 2. Uanset hvilken række, refererer den første sensor altid til opstrøms iltsensoren (før den katalytiske tank), Den 2. sensor refererer altid til den nedstrøms iltsensor (efter den katalytiske tank). Den elektroniske styreenhed (ECU) overvåger kredsløbet, der opvarmer iltsensoren. Når ECU'en registrerer et problem med kredsløbet, der bruges til at måle iltindholdet i udstødningsgassen, vises denne fejlkode."
