		"zs": "Turboladeren bruger inertimomentumet af udstødningsgassen, der udledes fra motoren, til at drive turbinen, som igen driver koaksialhjulet for at sætte tryk på indsugningsluften og derved øge bilens kraft. Kompressoren er en kompressor. bruges til at øge effekten af forbrændingsmotoren Indsugningsluftkompressor Mere indsugningsluft giver mere ilt til motoren, hvilket gør det muligt for kontrolmodulet at give mere brændstof, hvilket øger effekten. Denne DTC angiver indsugningstryksensoren (nedstrøms for gasspjældsventilen) kredsløbsspænding Over den højeste kalibrerede værdi (5,0 volt). Denne DTC kan være et problem med Manifold Absolute Pressure (MAP) sensoren på nogle køretøjer."
