		"zs": "Transmissionsvæsketemperatursensoren (TFT) sender transmissionsvæsketemperaturen til den elektroniske styreenhed (ECU) i form af et elektrisk signal baseret på termistorens princip. Dens hovedfunktion er, at når temperaturen er for højt, vil transmissionskontrolmodulet (TCU) skifte ned og decelerere. For nogle nye biler bruger TCU'en dette temperatursignal til at bestemme transmissionsvæskens viskositet og derved justere linjetrykket og magnetventilens tryk. Hvis den elektroniske styreenhed (ECU) ) registrerer transmissionsvæsketemperaturen (TFT) sensorens signalspænding Pludselige ændringer, denne fejlkode vises. Årsagerne til fejlen omfatter fejlen i selve TFT-sensoren eller dens kredsløb eller stik, elektronisk kontrolmodul (PCM eller ECM) fejl, etc."
