		"zs": "Køretøjet kører med 1. gear-kommandoen slået til, og den elektroniske styreenhed (ECU) har registreret et forkert 3. gearforhold. Årsager til fejl omfatter transmissionsvæskeniveauet for lavt, gear-magnetventil, transmissionens hydrauliske tryksensor , Magnetventilfejl i ventilhus, indgangsakselhastighedssensor, udgangsakselhastighedssensor, kredsløb, led, transmissionskontrolmodulsvigt osv."
