		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Knastakslens rolle er at kontrollere åbning og lukning af ventilen. I det variable ventiltimingssystem ændrer den elektroniske knastakselreguleringsventil (eller oliekontrolventil, OCV) olietrykket til knastakseljusteringen (mekanisk) justerer vinklen på knastakslen for at sikre, at ventilen åbner og lukker på det optimale tidspunkt. Hvis indsugningsknastakseljusteringens ventilkredsløbsspænding er under den kalibrerede minimumværdi, vil fejlen Koden vises."
