	"P0107": {
		"zzs": "Alle bilproducenter",
		"dm": "P0107",
		"des": "Manifold absolut tryk/barometrisk trykkredsløb lavt",
		"sys": "Brændstof eller luft",
		"zs": "Manifold Absolute Pressure (MAP) sensor måler trykket (vakuum) i indsugningsmanifolden. Powertrain Control Module (PCM) justerer derefter forskellen mellem indsugningsmanifoldens tryk og atmosfærisk tryk Forskellen (lineært forhold til motoren) belastning) bruges som grundlag for at bestemme den grundlæggende brændstofindsprøjtningsmængde for injektoren for at hjælpe motoren med at opnå det bedste luft-brændstofforhold under forskellige belastninger. Den barometriske tryksensor (nogle gange også kaldet højhøjdekompensator, HAC ) bruges til at sende barometertryk som et elektrisk signal til det elektroniske kontrolmodul. Barometertryk varierer med vejr og højde. Jo lavere tryk, jo tyndere luft. Powertrain Control Module (PCM) Værdien af trykket for at korrigere brændstoftilførslen for at hjælpe motor opnår det bedste luft-brændstofforhold Hvis den elektroniske styreenhed (ECU) registrerer, at manifold absolutte tryk (MAP) sensor/lufttryksensor signalspænding er lavere end den kalibrerede lave værdi, vil denne fejlkode fremkomme Årsager til fejl omfatter bl.a. MAP eller barometertryk (BARO) sensorsignalkredsløb åbent eller kortsluttet til jord, spændingsreferencekredsløb (VREF) åbent, sensorfejl eller elektronisk kontrolmodul (PCM eller ECM) fejl osv."
	},
