		"sys": "computer eller hjælpeudgangskredsløb",
		"zs": "Motorkontrolmodulet, også kendt som motorkontrolenheden (nogle indbyggede motorkontrolmoduler og transmissionskontrolmoduler er integreret i et drivlinjekontrolmodul), styrer driften af hele motoren. Dens hovedfunktion er at kontrollere den optimale mængde brændstofindsprøjtning og tændingstidspunkt for motoren. En anden vigtig rolle er den komponent, der er ansvarlig for overvågning af udstødningsemissionskontrol. Transmissionskontrolmodulet (TCM eller TCU) hjælper transmissionen med at beslutte, hvornår den skal Og hvordan man skifter gear til få bilen til at forbedre ydeevnen, skifte jævnt og spare brændstofforbrug. Denne fejlkode angiver, at den elektroniske styreenhed (ECU)/motorkontrolmodul (ECM)/transmissionskontrolmodul (TCU) temperatursensorsignal er højere end den kalibrerede maksimumværdi. Kontrolmodulet er midlertidigt lukket ned for at undgå skader på grund af overophedning."
