		"des": "Brændstofskinnetryksensor A kredsløbsområde/ydelse",
		"sys": "Brændstof eller luft",
		"zs": "Brændstoftrykregulatoren bruger en fjederdrevet ventil til at føre overskydende benzin tilbage til tanken, hvorved der opretholdes konstant tryk i brændstofkredsløbet. Brændstoftrykregulatoren har en vakuumledning forbundet til indsugningen. Sørg for tilsvarende benzintryk under forskellige motordriftsforhold (bedømmer motorbelastningen efter graden af vakuum). De fleste bilers brændstoftrykregulatorer er placeret på brændstofforgreningsrøret, men nogle bilers brændstoftryksregulatorer er placeret i brændstoftanken. Brændstoftryksensoren måler brændstoftryk nær injektoren. Den elektroniske kontrolenhed (ECU) bruger dette signal til at justere injektorens pulsbredde og måle mængden af brændstof, der kommer ind i forbrændingskammeret. Den elektroniske kontrolenhed (ECU) overvåger brændstofmanifoldens tryk Referencespændingen for sensor. Hvis denne spænding er uden for det normale område i et bestemt tidsrum, vises denne DTC."
