		"zs": "Motorkontrolmodulet, også kendt som motorkontrolenheden (nogle indbyggede motorkontrolmoduler og transmissionskontrolmoduler er integreret i et drivlinjekontrolmodul), styrer driften af hele motoren. Dens hovedfunktion er at kontrollere den optimale mængde brændstofindsprøjtning og tændingstidspunkt for motoren. En anden vigtig rolle er den komponent, der er ansvarlig for overvågning af udstødningsemissionskontrol. Transmissionskontrolmodulet (TCM eller TCU) hjælper transmissionen med at beslutte, hvornår den skal Og hvordan man skifter gear, så at bilen forbedrer ydeevnen, skifter jævnt og sparer brændstofforbrug."
