		"zs": "Når motoren lige er startet, oxiderer det sekundære luftindsprøjtningssystem de dannede kulbrinter, kulilte og andre skadelige gasser ved at tvinge luft ind i udstødningsmanifolden. Denne proces accelererer også opvarmningen af katalysatoren. Proces. Hvis den elektroniske styreenhed (ECU) detekterer en kortslutning i det sekundære luftindsprøjtningssystems styremagnetventilkredsløb, vil denne fejlkode fremkomme. Årsagen til fejlen omfatter det sekundære luftindsprøjtningsaktuatorkredsløb åbent kredsløb eller kortslutning til positiv, skifteventil fejl, sekundær luftindsprøjtningspumpesvigt, relæfejl eller elektronisk kontrolmodul (PCM eller ECM) fejl osv."
