		"zs": "EVAP-systemet (Evaporative Emission) leder benzindampe fra brændstoftanken til en lagertank, der indeholder aktivt kul, der absorberer benzindampe. Motoren bruger derefter frisk luft til at skylle disse benzindampe ind i motorens forbrændingskammer. Motoren Normal drift, men ikke i tomgang. Hvis den elektroniske kontrolenhed (ECU) ikke registrerer nogen skyllestrøm til fordampningsemissionssystemet (EVAP), skyldes det generelt en blokeret brændstofdampledning, en stor brændstofdamplækage eller flere små brændstoffer damplækager forårsaget."
