		"des": "Drivmotor B Fase U Strømsensorkredsløbsområde/ydelse",
		"sys": "Hybridsystem",
		"zs": "Hybrid Vehicle Electronic Control Unit (HV ECU) er ansvarlig for at overvåge drivmotorens inverterstrømsensor. Denne DTC vises, hvis HV ECU'en registrerer en fejl."
