	"P0403": {
		"zzs": "Alle bilproducenter",
		"dm": "P0403",
		"des": "Recirkulation af udstødningsgas A kontrolkredsløb",
		"sys": "Emissionskontrol",
		"zs": "Rollen for udstødningsgasrecirkulationssystemet (EGR) er at lede en lille mængde udstødningsgas ind i indsugningsmanifolden, når motoren kører med høj belastning. Tilstedeværelsen af disse udstødningsgasser reducerer temperaturen og trykket på forbrændingskammeret, hvorved emissionerne af nitrogenoxidforurening reduceres. For køretøjer med elektronisk udstødningsgasrecirkulation (EEGR) vil den elektroniske kontrolenhed (ECU) løbende overvåge EEGR-spolerne, kredsløb. Hvis en tilstand såsom et åbent kredsløb, en kortslutning er fundet, vises denne DTC. På dette tidspunkt vil hele EEGR-systemet blive deaktiveret, og anden overvågning af EEGR vil blive afsluttet. Årsager til fejl omfatter EEGR-aktuator eller dens kredsløb, ledfejl, EEGR-hejsemotor, elektronisk kontrolmodul, etc."
	},
