		"zs": "Starterrelæets (magnetventil) funktionsprincip er, at når tændingskontakten er tændt, løber der en lille strøm gennem en magnetspole, hvilket får et par større kontaktorer til at kombinere, hvilket tillader en stor strøm at flyde gennem motoren, og start motoren. Denne DTC angiver et defekt starterrelækredsløb. Årsager omfatter starteren, dens kredsløb, stik eller den elektroniske kontrolenhed (ECU)."
