		"sys": "computer eller hjælpeudgangskredsløb",
		"zs": "Hvis længden af indsugningsmanifoldpassagen (løber) er optimal, vil trykbølgen, der genereres af ventilens lukning, hjælpe med at lede olie-luftblandingen ind i motoren. Problemet er, at den optimale indsugningsmanifoldpassagelængde for forskellige motorhastigheder er også forskellig Funktionen af manifold tuning ventilen (MTV) er at lede indsugningsluften ind i indsugningsmanifoldens passager af forskellig længde i henhold til motorhastigheden, for at optimere motorens drejningsmoment ved forskellige hastigheder . Hvis den elektroniske styreenhed (ECU) er automatisk. Denne fejlkode vises, når indsugningsmanifoldens tuningventils styrekredsspænding detekteres at være lavere end den kalibrerede minimumværdi under inspektion."
