		"dm": "P0241",
		"des": "Turbolader/superlader Boost Sensor B Circuit Low",
		"sys": "Brændstof eller luft",
		"zs": "Turboladeren bruger inertimomentumet af udstødningsgassen, der udledes fra motoren, til at drive turbinen, som igen driver koaksialhjulet for at sætte tryk på indsugningsluften og derved øge bilens kraft. Kompressoren er en kompressor. bruges til at øge effekten af forbrændingsmotoren Luftkompressor til indsugningsluft Mere indsugningsluft giver mere ilt til motoren, hvilket gør det muligt for kontrolmodulet at give mere brændstof, hvilket øger effekten Boostsensor, også kaldet ladetryksensor (BPS), Dens funktion er at overføre ladetrykket som et elektrisk signal til den elektroniske styreenhed (ECU). Hvis boostsensorens signalspænding er lavere end 0,25 volt, vises denne fejlkode."
