		"dm": "P0109",
		"des": "Manifold absolut tryk/barometrisk trykkredsløb intermitterende",
		"sys": "Brændstof eller luft",
		"zs": "Manifold Absolute Pressure (MAP) sensor måler trykket (vakuum) i indsugningsmanifolden. Powertrain Control Module (PCM) justerer derefter forskellen mellem indsugningsmanifoldens tryk og atmosfærisk tryk Forskellen (lineært forhold til motoren) belastning) bruges som grundlag for at bestemme den grundlæggende brændstofindsprøjtningsmængde for injektoren for at hjælpe motoren med at opnå det bedste luft-brændstofforhold under forskellige belastninger. Den barometriske tryksensor (nogle gange også kaldet højhøjdekompensator, HAC ) bruges til at sende barometertryk som et elektrisk signal til det elektroniske kontrolmodul. Barometertryk varierer med vejr og højde. Jo lavere tryk, jo tyndere luft. Powertrain Control Module (PCM) Værdien af trykket for at korrigere brændstoftilførslen for at hjælpe motor opnår det bedste luft-brændstofforhold Hvis den elektroniske styreenhed (ECU) registrerer en pludselig ændring i signalspændingen for manifold absolutt tryk (MAP) sensor/lufttryksensor, vil denne fejlkode fremkomme. Årsagen til fejlen omfatter MAP eller barometertryk (BARO) sensorsignalkredsløbet er åbent eller kortsluttet til jord (intermitterende), spændingsreferencekredsløbet (VREF) er åbent, sensorfejl osv."
