		"zs": "Knastakslens rolle er at kontrollere åbning og lukning af ventilen. I det variable ventiltimingssystem ændrer den elektroniske knastakselreguleringsventil (eller oliekontrolventil, OCV) Vinklen på knastakslen justeres ved hjælp af olietryk til knastakseljusteringen (mekanisk) for at sikre, at ventilerne åbner og lukker på det optimale tidspunkt. Dette optimerer motorens effektivitet og effekt i alle omdrejningsområder. Hvis den elektroniske styreenhed (ECU) registrerer, at En (indsugnings/venstre/forreste) styrekredsspænding for knastakselprofil har været lavere end den kalibrerede minimumværdi i en periode, så vil denne fejlkode fremkomme."
