		"sys": "Brændstof eller luft",
		"zs": "Brændstoftemperatursensoren overvåger temperaturen på det brændstof, der går til brændstofpumpen for at undgå damplås forårsaget af for høj temperatur (120 grader Celsius), som kan forårsage skade på brændstofpumpen eller injektorerne. Elektronisk kontrolenhed (ECU) ) ) overvåger kontinuerligt brændstoftemperaturfølerens signalspænding. Hvis denne spænding falder under den minimale kalibrerede værdi (0,1 volt eller 106 grader Celsius) i et bestemt tidsrum, vises denne DTC."
