	"P018B": {
		"zzs": "Alle bilproducenter",
		"dm": "P018B",
		"des": "Brændstoftryksensor B Kredsløbsområde/ydelse",
		"sys": "Brændstof eller luft",
		"zs": "Brændstoftrykregulatoren bruger en fjederdrevet ventil til at føre overskydende benzin tilbage til tanken, hvorved der opretholdes konstant tryk i brændstofkredsløbet. Brændstoftrykregulatoren har en vakuumledning forbundet til indsugningen. Sørg for tilsvarende benzintryk under forskellige motordriftsforhold (bedømmer motorbelastningen efter graden af vakuum). De fleste bilers brændstoftrykregulatorer er placeret på brændstofforgreningsrøret, men nogle bilers brændstoftrykregulatorer er placeret i brændstoftanken. Brændstoftryksensoren er ansvarlig til måling af brændstoftrykket nær injektoren. Den elektroniske styreenhed (ECU) bruger dette signal til at justere injektorens pulsbredde og måle mængden af brændstof, der kommer ind i forbrændingskammeret. Den elektroniske styreenhed (ECU) overvåger kontinuerligt brændstoftryksensorens signal Spænding. Hvis denne spænding overstiger den normale kalibreringsværdi i et bestemt tidsrum, vises denne fejlkode."
	},
