		"dm": "P0677",
		"des": "Cylinder 7 gløderørskredsløb/åben",
		"sys": "computer eller hjælpeudgangskredsløb",
		"zs": "Gløderørets funktion er at opvarme den komprimerede gas i dieselmotorens forbrændingskammer gennem varmespiralen, hvilket gør dieselmotoren nem at starte, når den er kold. Gløderørskontrolmodulet kan automatisere gløderørsforvarmning og cyklingsprocessen. Hvis den elektroniske styring Enheden (ECU) har registreret en funktionsfejl i cylinder 7 gløderørskredsløbet, og denne DTC vises."
