		"zs": "Luftstrømssensorens (MAF) rolle er at omdanne luftstrømmen til et elektrisk signal og sende den til den elektroniske styreenhed (ECU), som et af de grundlæggende signaler til bestemmelse af brændstofindsprøjtningsmængden. Denne fejlkode angiver, at på grund af luftstrømmen (MAF) ) Sensor A kredsløbsfejl, der resulterer i lav luftstrøm."
