		"dm": "P0B02",
		"des": "Hjælpetransmissionsvæskepumpemotor fase U Strøm høj",
		"sys": "Hybridsystem",
		"zs": "Funktionen af transmissionsvæskepumpen er at give arbejdstryk til transmissionsvæsken, når motoren arbejder. Skiftmagnetventilen styrer det hydrauliske tryk til transmissionskoblingen ved at åbne eller lukke transmissionsvæskens kontrolventil for at styre dens adskillelse og indgreb, Derved opnås gearskifte. Formålet med den ekstra transmissionsvæskepumpe er at give tryk til transmissionsvæsken, når motoren ikke kører (såsom når man trækker en trailer) for at forhindre transmissionen i at overophedes."
