		"zs": "Skiftemagnetventilen styrer det hydrauliske tryk til transmissionskoblingen ved at åbne eller lukke transmissionsvæskekontrolventilen for at kontrollere dens udkobling og indkobling for skift. Årsagerne til denne fejlkode inkluderer, at transmissionsvæskeniveauet er for højt lavt , transmissionsvæsken er for snavset, mekanisk fejl på skiftemagnetventil, fejl i kredsløb, stik eller transmissionskontrolmodul (TCM), osv."
