		"dm": "P0584",
		"des": "Cruise Control Vakuum Control Circuit High",
		"sys": "Køretøjshastighed og tomgangshastighedskontrol",
		"zs": "Fartpilotsystemet styrer gashåndtagets vinkel ved at kontrollere vakuumet i servoen og derved kontrollere køretøjets hastighed. Når acceleration er påkrævet, åbner vakuummagnetventilen, kommunikerer med indsugningsmanifolden (eller en speciel vakuumpumpe) , og tætninger Vakuumgraden i muffen øges, membranen suges for at overvinde fjederkraften, og åbningen af gasspjældet øges gennem trækwiren, og køretøjet accelererer.Når den indstillede hastighed er nået, vil vakuumsolenoiden ventilen og ventilationsmagnetventilen lukkes samtidig, og tætningsmuffen er på dette tidspunkt. Vakuumet indvendigt forbliver uændret, og bilen fortsætter med at køre med konstant hastighed. Når det er nødvendigt at bremse, åbner ventilationsmagnetventilen for at lukke luft ind i tætningsmuffen, presser membranfjederen membranen tilbage til dens oprindelige position, og gasspjældets åbning mindskes, så bilen bremser .P0584 indikerer, at vakuumstyrekredsløbets spænding er højere end den kalibrerede maksimumværdi. Årsager til fejl omfatter fartpilotens vakuumkontrolsolenoider, kredsløb, stik osv."
