		"dm": "P046A",
		"des": "Katalysatortemperatursensor 1/2 korrelation (bank 1)",
		"sys": "Emissionskontrol",
		"zs": "En katalysator (også kaldet en katalysator) er en udstødningsrensningsanordning, der bruger en katalysators virkning til at omdanne CO, HC og NOx i udstødningen til gasser, der er uskadelige for den menneskelige krop. Den er generelt placeret før lyddæmperen i udstødningsrøret. Denne DTC angiver, at signalforskellen på katalysatorens temperaturføler 1/2 overstiger den indstillede maksimumgrænse."
