		"zs": "Injektorens funktion er at forstøve brændstoffet, så det opfylder kravene til forbrænding. Arbejdsprincippet er, at når den elektromagnetiske spole aktiveres, genereres der sug, nåleventilen suges op, dysehullet åbnes, og brændstoffet passerer gennem nåleventilhovedet. Det ringformede mellemrum mellem akselnålen og delens dysehul sprøjtes med høj hastighed for at danne en tåge. Den elektroniske styreenhed styrer brændstofindsprøjtningsmængden ved at styre åbningstidsinterval (også kaldet pulsbredden) af injektoren Hvis den 6. cylinderinjektor Denne DTC vises, når styrekredsløbets spænding er under den kalibrerede minimumværdi Årsager omfatter injektorkontrolkredsløbet, stikket eller selve injektoren; injektorkontrolmodulet (FICM)."
