	"P0145": {
		"zzs": "Alle bilproducenter",
		"dm": "P0145",
		"des": "O2 sensorkredsløb langsom respons (bank 1, sensor 3)",
		"sys": "Brændstof eller luft",
		"zs": "Liltsensorens funktion er at måle iltindholdet i motorens udstødningsgas for at korrigere brændstofindsprøjtningsmængden, så motoren kan opnå det bedste luft-brændstofforhold. I OBD-fejlkoden, du vil ofte se antallet af rækker og tal Iltsensor. Række 1 refererer til rækken hvor cylinder 1 er placeret, og den resterende række er række 2. Uanset hvilken række, refererer den første sensor altid til opstrøms iltsensoren (før den katalytiske tank), Den anden sensor er altid den nedstrøms iltsensor (efter den katalytiske tank). Den opvarmede iltsensor monitorerer hastigheden af spændingsændringen under stigningen og faldet af iltsensorens signal. Når hastigheden af spændingsændringen er lavere end den kalibrerede værdi, vil den elektroniske styreenhed (ECU) begynde at ændre luft-brændstofforholdet i et forsøg på at øge hastigheden af spændingsændringen af iltsensoren. Hvis ECU'en har nået den acceptable brændstoftrimgrænse eller har overskredet den acceptable brændstoftrimlængde og stadig ikke overvåger en acceptabel spænding. Hvis ændringshastigheden ændres, vises denne DTC. Årsager til fejl omfatter forurening af iltsensoren på grund af silicium i brændstoffet, åbent kredsløb i iltsensorens signalkredsløb, svigt af selve iltsensoren, lækage i udstødningsrøret eller udstødningsmanifolden, elektronisk kontrolmodul ( PCM eller ECM) fejl , etc."
	},
	"P0352": {
		"zzs": "Alle bilproducenter",
		"dm": "P0352",
		"des": "Tændingsspole B Primær/Sekundær Kreds",
		"sys": "Tændingssystem",
		"zs": "Tændspolens rolle er at omdanne 12-volts spænding på bilbatteriet til tusinder eller endda titusinder af volt, der kræves til tændrørstænding. Der er to sæt spoler i tændspolen, primær spole og sekundær spole. Primærspolen har tykkere emaljeret tråd har færre vindinger; sekundærspolen bruger tyndere emaljeret tråd, som har relativt flere vindinger. Når primærspolen tændes, genereres et stærkt magnetfelt omkring den, da strømmen stiger, og jernkernen lagrer magnetisk feltenergi; når omskifteren afbryder primærspolens kredsløb, falder primærspolens magnetfelt hurtigt, og der induceres en højspænding i sekundærspolen. Den elektroniske styreenhed (ECU) overvåger løbende hvert tændingshovedkredsløb. Hvis ECU'en ikke modtager et gyldigt tændingsdiagnosemonitor (IDM) pulssignal fra tændingsmodulet (integreret i ECU'en), vil fejlkoden fremkomme. Årsagerne til fejlen omfatter tændingsstart/kørsel kredsløb, tændspolekredsløb, selve tændspolefejl, elektronisk kontrolmodul (PCM eller ECM) fejl osv."
	},
