		"zs": "Brændstofpumpekredsløbet er opdelt i et hovedkredsløb og et sekundærkredsløb. Hovedkredsløbet er ansvarligt for at styre brændstofpumpen, og brændstofpumperelæet bruger den lave strøm fra den elektroniske styreenhed (ECU) til at styre den elektromagnetiske spole, og derved tænder brændstofpumpens høje strøm. Det sekundære kredsløb refererer til brændstofpumpens monitor (FPM) kredsløb, som er ansvarlig for at overvåge brændstofpumpens kredsløbsfeedback. Fejlårsagerne til P0231 omfatter kredsløbet fra brændstofpumpemonitoren (FPM) til brændstofpumperelæet, brændstofpumpens relækredsløb og brændstofpumperelæet, elektronisk kontrolenhed (ECU) osv."
