	"P0042": {
		"zzs": "Alle bilproducenter",
		"dm": "P0042",
		"des": "HO2S varmekontrolkredsløb (bank 1, sensor 3)",
		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Liltsensorens funktion er at måle iltindholdet i motorens udstødningsgas for at korrigere brændstofindsprøjtningsmængden, så motoren kan opnå det bedste luft-brændstofforhold. I OBD-fejlkoden, du vil ofte se antallet af rækker og tal Iltsensor. Række 1 refererer til rækken hvor cylinder 1 er placeret, og den resterende række er række 2. Uanset hvilken række, refererer den første sensor altid til opstrøms iltsensoren (før den katalytiske tank), Den 2. sensor refererer altid til den nedstrøms iltsensor (efter den katalytiske tank) Den elektroniske styreenhed (ECU) holder iltsensorens temperatur 780oC ved at styre tænd/sluk af iltsensorvarmeren. iltsensoren fungerer ikke inden for den indstillede tid. Når den ønskede temperatur er nået, eller ECU'en ikke kan opretholde den indstillede temperatur, vises denne fejlkode."
	},
