		"sys": "Hybridsystem",
		"zs": "Batterikontrolmodulet er ansvarlig for at overvåge batteriblokkenes spænding. Hvis spændingsforskellen mellem batteriblokkene overstiger standardværdien, vises denne fejlkode."
