		"zs": "Funktionen af hybridbatterispændingsovervågningskredsløbet er at overføre batteriblokkens spænding til kontrolmodulet for at overvåge opladning og afladning af batteriblokken samt mulige kortslutnings- og åben-kredsløbsforhold ."
