		"sys": "Brændstof eller luft",
		"zs": "Brændstoftrimning er, når den elektroniske kontrolenhed (ECU) styrer brændstoftilførslen ved at øge eller formindske åbningstiden for injektorerne, så motoren opnår det optimale luft-brændstof-forhold (14,7:1 luft-til-benzin masse) forhold) Luft-til-brændstof-forholdet er for rigt til for meget brændstoftilførsel, og for magert til for lidt brændstoftilførsel. Denne DTC vises, hvis brændstoftrimningen når og forbliver ved den maksimale grænse i længere tid end en vis tid."
