		"zs": "Liltsensorens funktion er at måle iltindholdet i motorens udstødningsgas for at korrigere brændstofindsprøjtningsmængden, så motoren kan opnå det bedste luft-brændstofforhold. I OBD-fejlkoden, du vil ofte se antallet af rækker og tal Iltsensor. Række 1 refererer til rækken hvor cylinder 1 er placeret, og den resterende række er række 2. Uanset hvilken række, refererer den første sensor altid til opstrøms iltsensoren (før den katalytiske tank), Den anden sensor refererer altid til den nedstrøms iltsensor (efter katalysatortanken) Den opvarmede iltsensor monitorerer om iltsensorens signalrespons pga. brændstofovergang svarer til den korrekte iltsensorbank (Bank) Evt. Årsagerne til denne DTC inkluderer iltsensorstik blandet sammen, ledninger blandet osv."
