		"des": "Cylinder 4 brændstofinjektor offset læring ved maksimal grænse",
		"sys": "Brændstof eller luft",
		"zs": "Injektorens funktion er at forstøve brændstoffet, så det opfylder kravene til forbrænding. Arbejdsprincippet er, at når den elektromagnetiske spole aktiveres, genereres der sug, nåleventilen suges op, dysehullet åbnes, og brændstoffet passerer gennem nåleventilhovedet. Det ringformede mellemrum mellem akselnålen og delens dysehul sprøjtes med høj hastighed for at danne en tåge. Den elektroniske styreenhed styrer brændstofindsprøjtningsmængden ved at styre åbningstidsinterval (også kaldet pulsbredden) af injektoren. Hvis den elektroniske styreenhed (ECU) Det detekteres, at kompensationsindlæringen af den 4. cylinderinjektor har nået den maksimale indlæringsgrænse, og denne fejlkode vises."
