		"sys": "computer eller hjælpeudgangskredsløb",
		"zs": "Injektorkontrolmodulet (FICM) er ansvarligt for at styre injektorens magnetventil baseret på brændstof- og tidsinformation fra det elektroniske kontrolmodul (ECU). Den elektroniske kontrolenhed (ECU) styrer injektoråbningsintervallet ( også kendt som pulsbredde) for at kontrollere mængden af indsprøjtet brændstof. P0611 angiver, at relæstyringen til brændstofinjektorkontrolmodulet (FICM) er fejlet."
