		"des": "Generator inverter over temperatur",
		"sys": "Hybridsystem",
		"zs": "Vekselretterens funktion er at konvertere jævnstrøm til vekselstrøm. Denne fejlkode angiver, at temperaturføleren på generatorens generator viser, at temperaturen er for høj. Årsagen til fejlen omfatter en fejl i motorens elektroniske kølesystem, transmissionsvæskeniveauet er for lavt, transmissionen eller transmissionskontrolmodulet fejl."
