		"des": "Motorelektronik kølevæskepumpe A kontrolkredsløb/åben",
		"sys": "Hybridsystem",
		"zs": "Motor Electronic System Cooling System (MECS) er et uafhængigt system, der sørger for køling til gearkassen (f.eks. eCVT) motor, styremodul og DC/DC-konverter. Det har sin egen radiator, kølevæskepumpe, kølevæsketemperaturføler osv. Motorens elektroniske kølesystems kølevæskepumpe er en 12 volt spændings elektrisk pumpe styret af en elektronisk styreenhed (ECU) Hvis kontrolmodulet konstaterer, at motorens elektroniske kølesystems kølevæskepumpe er tvangsjordet, er der stadig en stor mængde strøm til stede; eller motorens elektroniske systemkølevæskepumpe er ikke jordet, og der detekteres ingen spænding; denne fejlkode vises."
