		"zs": "Brændstofniveausensoren bruger princippet om en flyder i brændstoftanken og en variabel modstand til at sende brændstofniveauet i brændstoftanken til det elektroniske styremodul i form af et elektrisk signal. Hvis den elektroniske styreenhed (ECU) finder brændstofniveauet Hvis indgangssignalet er uden for det kalibrerede område, vises denne fejlkode."
