		"des": "Termostat varmekontrolkredsløb lavt",
		"sys": "Køretøjshastighed og tomgangshastighedskontrol",
		"zs": "Termostatens funktion er at lukke, når kølevæsketemperaturen er lav, kun lade kølevæsken cirkulere i motoren og øge hastigheden på den varme bil; når vandtemperaturen overstiger den indstillede temperatur, vil termostaten åbner for at tillade køling Væsken cirkuleres til radiatoren i vandtanken, hvilket effektivt kan forbedre køleeffektiviteten Denne fejlkode angiver, at den elektroniske styreenhed (ECU) registrerer, at spændingen i termostatvarmerens styrekredsløb er lavere end minimumsværdien af kalibreringen. Årsagen til fejlen omfatter termostatvarmeren, dens kredsløb, stik eller relæ."
