		"sys": "Brændstof eller luft",
		"zs": "Injektorens funktion er at forstøve brændstoffet, så det opfylder kravene til forbrænding. Arbejdsprincippet er, at når den elektromagnetiske spole aktiveres, genereres der sug, nåleventilen suges op, dysehullet åbnes, og brændstoffet passerer gennem nåleventilhovedet. Det ringformede mellemrum mellem akselnålen og delens dysehul sprøjtes med høj hastighed for at danne en tåge. Den elektroniske styreenhed styrer brændstofindsprøjtningsmængden ved at styre åbningstidsinterval (også kaldet pulsbredden) af injektoren Hvis den elektroniske styreenhed (ECU) Det detekteres, at afvigelsen mellem den faktiske timing af brændstofinjektoren og den ideelle brændstofindsprøjtningstid overskrider den maksimale grænse, og denne fejl kode vises."
