		"des": "MAP/MAF - Gasspjældpositionskorrelation",
		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Manifold Absolute Pressure (MAP)-sensoren måler trykket (vakuum) i indsugningsmanifolden. Powertrain Control Module (PCM) justerer derefter forskellen mellem indsugningsmanifoldens tryk og atmosfærisk tryk Forskellen (lineært forhold til motorbelastningen) ) bruges som grundlag for at bestemme den grundlæggende brændstofindsprøjtningsmængde af injektoren for at hjælpe motoren med at opnå det bedste luft-brændstofforhold under forskellige belastninger. Luftstrømssensorens (MAF) rolle er at omdanne luftstrømmen til den elektriske signal sendes til den elektroniske styreenhed (ECU) som et af de grundlæggende signaler til at bestemme brændstofindsprøjtningsmængden. Funktionen af gasspjældets position (TP) sensor er at sende spjældventilens åbningsgrad til den elektroniske styreenhed (ECU) ) i form af et elektrisk signal, som en af de grundlæggende parametre til styring af motorens brændstofindsprøjtning. Hvis ECU'en konstaterer, at belastningen beregnet af manifoldens absolutte tryk (MAP) sensor/luftstrøm (MAF) sensor og gasspjældpositionen ( TP) sensoren er for anderledes, fejlkoden vises."
