	"P0055": {
		"zzs": "Alle bilproducenter",
		"dm": "P0055",
		"des": "HO2S-varmemodstand (bank 1, sensor 3)",
		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Liltsensorens funktion er at måle iltindholdet i motorens udstødningsgas for at korrigere brændstofindsprøjtningsmængden, så motoren kan opnå det bedste luft-brændstofforhold. I OBD-fejlkoden, du vil ofte se antallet af rækker og tal Iltsensor. Række 1 refererer til rækken hvor cylinder 1 er placeret, og den resterende række er række 2. Uanset hvilken række, refererer den første sensor altid til opstrøms iltsensoren (før katalysatorbeholderen), Den 2. føler refererer altid til den nedstrøms iltføler (efter katalysatorbeholderen). Denne DTC angiver, at strømmen til varmerens styrekredsløb for den opvarmede iltføler er for lav eller for høj."
	},
	"P099D": {
		"zzs": "Alle bilproducenter",
		"dm": "P099D",
		"des": "Skift solenoide H kontrolkredsløbsområde/ydelse",
		"sys": "Gearkasse",
		"zs": "Skiftemagnetventilen styrer det hydrauliske tryk til transmissionskoblingen ved at åbne eller lukke transmissionsvæskekontrolventilen for at kontrollere dens udkobling og indkobling for skift. Årsagerne til denne fejlkode inkluderer, at transmissionsvæskeniveauet er for højt lavt , transmissionsvæsken er for snavset, mekanisk fejl på skiftemagnetventil, fejl i kredsløb, stik eller transmissionskontrolmodul (TCM), osv."
	},
	"P0727": {
		"zzs": "Alle bilproducenter",
		"dm": "P0727",
		"des": "Indgangskredsløb for motorhastighed intet signal",
		"sys": "Gearkasse",
		"zs": "Motorhastigheden (også kendt som den indgående akselhastighed) er et vigtigt grundlag for transmissionskontrolmodulet (TCU) til at bestemme gearforhold og skift osv. Under motordrift vil den elektroniske styreenhed (ECU) hhv. transmissionskontrolmodul (TCU) registrerede ikke motorhastighedsinputsignalet på CAN højhastighedstransmissionsnetværket. Årsager til fejl omfatter motorhastighedssensor, kredsløb, stik, sensorhjulsfejl eller elektronisk styreenhed (ECU)."
	},
	"P00A2": {
		"zzs": "Alle bilproducenter",
		"dm": "P00A2",
		"des": "Ladeluftkøler temperatursensor kredsløb lavt (bank 2)",
		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Turboladeren bruger inertimomentum af udstødningsgassen, der udledes fra motoren, til at drive turbinen, som igen driver koaksialhjulet til at sætte tryk på indsugningsluften og derved øge bilens effekt. Ladeluftkøleren ( også kaldet intercooler) ) bruges til at køle den overladede luft fra superchargeren. Efter at luften er passeret gennem superchargeren, stiger trykket, og temperaturen stiger. Den overladede lufttemperatur kan reduceres af supercharger-luftkøleren og derved øge luften tæthed og forøgelse af opladningseffektiviteten for at øge motoreffekten og reducere emissioner. Årsager til denne fejlkode omfatter ladeluftkølertemperaturføler, dens kredsløb eller ledproblemer."
	},
	"P0648": {
		"zzs": "Alle bilproducenter",
		"dm": "P0648",
		"des": "Startspærrelampekontrolkredsløb",
		"sys": "computer eller hjælpeudgangskredsløb",
		"zs": "Tyverisikringskontrolmodulets rolle er at sikre, at bilen kun vil tillade bilen at starte, hvis den dedikerede nøgle er til stede, og den matcher de forskellige komponenter."
	},
	"P0277": {
		"zzs": "Alle bilproducenter",
		"dm": "P0277",
		"des": "Cylinder 6 Injector Circuit High",
		"sys": "Brændstof eller luft",
		"zs": "Injektorens funktion er at forstøve brændstoffet, så det opfylder kravene til forbrænding. Arbejdsprincippet er, at når den elektromagnetiske spole aktiveres, genereres der sug, nåleventilen suges op, dysehullet åbnes, og brændstoffet passerer gennem nåleventilhovedet. Det ringformede mellemrum mellem akselnålen og delens dysehul sprøjtes med høj hastighed for at danne en tåge. Den elektroniske styreenhed styrer brændstofindsprøjtningsmængden ved at styre åbningstidsinterval (også kaldet injektorens pulsbredde) Hvis 6. cylinderinjektor Styrekredsspændingen er højere end den kalibrerede maksimumværdi, vil denne fejlkode fremkomme. Årsagen til fejlen omfatter injektorstyrekredsløbet, stikket , eller selve injektoren; injektorkontrolmodulet (FICM)."
	},
