		"dm": "P0A04",
		"des": "Motorelektronik kølevæsketemperatursensorkredsløb intermitterende",
		"sys": "Hybridsystem",
		"zs": "Motor Electronic System Cooling System (MECS) er et uafhængigt system, der sørger for køling til gearkassen (f.eks. eCVT) motor, styremodul og DC/DC-konverter. Det har sin egen radiator, kølevæskepumpe, kølevæsketemperaturføler osv. Motorens elektroniske systemkølevæsketemperatur (MECT) sensor anvender princippet om termistor til elektronisk at overføre temperaturen på motorens elektroniske systemkølevæske til den elektroniske styreenhed (ECU) Hvis kontrolmodulet registrerer, at den målte Denne DTC vises hvis spændingen i Motor Electronic System Coolant Temperature (MECT)-sensoren pludselig ændres inden for kort tid."
