		"des": "Brændstofsystemtryk ved lavt tryk - for lavt, lav omgivelsestemperatur",
		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Lavtryksbrændstofpumpens rolle (40-95psi) er at sende benzin fra tanken til højtryksbrændstofpumpen. Den knastakseldrevne højtryksbrændstofpumpe kan sætte benzinen under tryk op til 1900psi. Brændstofsystemet skal holde et konstant tryk, Hvis olietrykket er for lavt, vil brændstofinjektoren indsprøjte for svagt eller ej. Hvis olietrykket er for højt, vil oliekredsløbet blive beskadiget, eller injektoren vil blive beskadiget. Denne fejlkode angiver at den elektroniske styreenhed (ECU) registrerer, at brændstoftrykket er for lavt. Tryk For lavt kan være et problem med brændstofpumpen, brændstofpumpens styremodul, brændstoftrykregulatoren, brændstoftryksensoren, brændstoflækage osv."
