	"P0722": {
		"zzs": "Alle bilproducenter",
		"dm": "P0722",
		"des": "Udgangshastighedssensorkredsløb intet signal",
		"sys": "Gearkasse",
		"zs": "Opgaven for udgangshastighedssensoren (OSS) er at sende hastighedssignalet fra transmissionens udgangsaksel til den elektroniske styreenhed (ECU). Hvis ECU'en ikke kan registrere OSS-signalet, vil denne fejlkode fremkomme. Årsagen til fejlen inkluderer OSS-sensoren Interferens fra ikke-standard tilbehør, OSS-sensorens selvfejl, kredsløb, stikfejl, elektronisk kontrolmodul (PCM eller ECM) fejl osv."
	},
	"P0646": {
		"zzs": "Alle bilproducenter",
		"dm": "P0646",
		"des": "A/C koblingsrelæ kontrolkredsløb lav",
		"sys": "computer eller hjælpeudgangskredsløb",
		"zs": "Klimaanlæggets remskive går kun i tomgang, når klimaanlægget er slukket. Kun når klimaanlæggets kobling (under påvirkning af magnetventilen) er kombineret, vil kompressoren blive drevet. Funktionen af klimaanlæggets koblingsrelæ skal styre adskillelsen og kombinationen af koblingen. Den elektroniske styreenhed (ECU) registrerede ikke spænding på A/C-relæets styrekredsløb, da A/C-koblingen blev kommanderet til at lukke."
	},
	"P0367": {
		"zzs": "Alle bilproducenter",
		"dm": "P0367",
		"des": "Knastakselpositionssensor B Kreds lav (bank 1)",
		"sys": "Tændingssystem",
		"zs": "Knastakslens rolle er at kontrollere åbning og lukning af ventilen. I det variable ventiltimingssystem ændrer den elektroniske knastakselreguleringsventil (eller oliekontrolventil, OCV) Vinklen på knastakslen justeres ved hjælp af olietryk til knastakseljusteringen (mekanisk) for at sikre at ventilen åbner og lukker på det optimale tidspunkt Knastakselpositionssensorens (CMP) rolle er at justere knastakselpositionen (den relative position) overføres til elektronisk styreenhed (ECU) i form af et spændingssignal Denne fejlkode angiver, at den elektriske B (udstødning/højre/bag) knastakselposition (CMP) sensorsignalspænding er under den kalibrerede minimumsværdi Årsagen til fejlen er bl.a. cam Shaft position (CMP) sensorkredsløb, led, fejl i sig selv eller fejl i det elektroniske kontrolmodul (PCM eller ECM) osv."
	},
	"P0477": {
		"zzs": "Alle bilproducenter",
		"dm": "P0477",
		"des": "Udstødningstrykreguleringsventil A Kreds lav",
		"sys": "Emissionskontrol",
		"zs": "Udstødningstrykreguleringsventilen er en ventil med variabel position. Dens hovedfunktion er at hjælpe motoren med at varme op hurtigt ved at ændre udstødningstrykket (forøget motorbelastning), når udetemperaturen er ekstremt lav (<5 grader Celsius) .Denne DTC vises, hvis den elektroniske kontrolenhed (ECU) registrerer, at udstødningstrykreguleringsventil A-kredsløbsspændingen er under den kalibrerede minimumværdi."
	},
	"P0427": {
		"zzs": "Alle bilproducenter",
		"dm": "P0427",
		"des": "Katalysatortemperatursensorkredsløb lavt (bank 1, sensor 1)",
		"sys": "Emissionskontrol",
		"zs": "En katalysator (også kaldet en katalysator) er en udstødningsrensningsanordning, der bruger en katalysators virkning til at omdanne CO, HC og NOx i udstødningen til gasser, der er uskadelige for den menneskelige krop. Den er generelt placeret før lyddæmperen i udstødningsrøret. Denne DTC angiver, at katalysatorens temperaturfølerkredsløbsspænding er lavere end den kalibrerede minimumsværdi. Årsager til fejl omfatter katalysatorens temperaturføler, kredsløb, stik eller elektronisk kontrolenhed (ECU) fejl."
	},
	"P0BE3": {
		"zzs": "Alle bilproducenter",
		"dm": "P0BE3",
		"des": "Temperaturføler F-kredsløb for drivmotor inverter",
		"sys": "Hybridsystem",
		"zs": "Inverterens rolle er at konvertere jævnstrøm til vekselstrøm. Den hybride elektroniske styreenhed (HV ECU) bruger en temperaturføler integreret i inverteren til at overvåge temperaturen på drivmotorinverteren. Hvis denne temperatur Hvis sensorudgangen er unormal, denne fejlkode vises."
	},
	"P0A34": {
		"zzs": "Alle bilproducenter",
		"dm": "P0A34",
		"des": "Drivmotor B Temperatursensorkredsløb intermitterende",
		"sys": "Hybridsystem",
		"zs": "Drivmotorens B-temperatursensorkredsløb er defekt. Årsagerne til fejlen omfatter kredsløb, stik, elektroniske styreenheder, drivmotorer osv. Drivmotortemperatursensoren i nogle køretøjer er integreret med drivmotoren. Derfor , hvis det fastslås, at temperaturen. Problemet med selve sensoren kan kræve udskiftning af hele drivmotoren."
	},
	"P06C7": {
		"zzs": "Alle bilproducenter",
		"dm": "P06C7",
		"des": "Cylinder 3 gløderør forkert",
		"sys": "computer eller hjælpeudgangskredsløb",
		"zs": "Gløderørets funktion er at opvarme den komprimerede gas i dieselmotorens forbrændingskammer gennem varmespolen, for at gøre dieselmotoren nem at starte i koldt vejr. Gløderørskontrolmodulet kan automatiser gløderørsforvarmningen og cyklingsprocessen. Denne fejlkode Angiver, at cylinder 3-gløderøret, dets kredsløb, stik eller glødeløbskontrolmodul (GPCM) er defekt."
	},
	"P0776": {
		"zzs": "Alle bilproducenter",
		"dm": "P0776",
		"des": "Trykkontrol solenoide B Ydelse/Slukket",
		"sys": "Gearkasse",
		"zs": "Skiftemagnetventilen styrer det hydrauliske tryk til transmissionskoblingen ved at åbne eller lukke transmissionsvæskekontrolventilen for at kontrollere dens udkobling og indgreb ved skift. Nøjagtig kontrol af transmissionsvæsketrykket er vigtig for jævn skift. Formålet med trykstyringsmagnetventil er til at styre trykket af transmissionsvæsken. Årsagen til fejlen omfatter trykstyringsmagnetventilens kontrolkredsløb, stikket eller selve magnetventilen. En kontrolmodulfejl kan også forårsage, at denne fejlkode vises. "
	},
	"P0379": {
		"zzs": "Alle bilproducenter",
		"dm": "P0379",
		"des": "Tidsreference Høj opløsning Signal B Ingen pulser",
		"sys": "Tændingssystem",
		"zs": "Den optiske sensor giver et højopløsningssignal til Powertrain Control Module (PCM) ved at tælle impulser på en sensorskive placeret i indsprøjtningspumpen. Dette signal er en af de vigtige referencer for PCM'en til at styre brændstof og timing. Årsager til denne fejlkode omfatter den optiske sensor, dens kredsløb, stik eller PCM."
	},
	"P0207": {
		"zzs": "Alle bilproducenter",
		"dm": "P0207",
		"des": "Injektorkredsløb/åben - Cylinder 7",
		"sys": "Brændstof eller luft",
		"zs": "Injektorens funktion er at forstøve brændstoffet, så det opfylder kravene til forbrænding. Arbejdsprincippet er, at når den elektromagnetiske spole aktiveres, genereres der sug, nåleventilen suges op, dysehullet åbnes, og brændstoffet passerer gennem nåleventilhovedet. Det ringformede mellemrum mellem akselnålen og delens dysehul sprøjtes med høj hastighed for at danne en tåge. Den elektroniske styreenhed styrer brændstofindsprøjtningsmængden ved at styre åbningstidsinterval (også kaldet pulsbredden) af injektoren. Hvis den elektroniske styreenhed (ECU) Når der detekteres en fejl i injektorens styrekredsløb, vil denne fejlkode fremkomme. Årsagerne til fejlen omfatter injektorinterface, kredsløbsfejl , selve injektorfejl, elektronisk kontrolmodul (PCM eller ECM) fejl osv."
	},
	"P0460": {
		"zzs": "Alle bilproducenter",
		"dm": "P0460",
		"des": "Brændstofniveausensor A Kreds",
		"sys": "Emissionskontrol",
		"zs": "Brændstofniveausensoren bruger princippet om en flyder i brændstoftanken og en variabel modstand til at overføre brændstofniveauet i brændstoftanken til det elektroniske styremodul i form af et elektrisk signal. Hvis ECU'en finder, at Selvom brændstoffet er betydeligt forbrugt, forbliver brændstoffet. Niveauaflæsningen forbliver den samme, og denne DTC vises."
	},
