		"zs": "En katalysator (også kaldet en katalysator) er en udstødningsrensningsanordning, der bruger en katalysators virkning til at omdanne CO, HC og NOx i udstødningen til gasser, der er uskadelige for den menneskelige krop. Det generelt er placeret før lyddæmperen på udstødningsrøret. Fejlkoden angiver, at katalysatoreffektiviteten er lavere end den indstillede minimumsgrænse efter forvarmning. Årsagerne til fejlen omfatter katalysatoren, iltsensoren og kredsløb, samlinger osv. årsagerne til fejlen omfatter udstødningsrøret eller udstødningsgaslækager nær udstødningsmanifolden, katalytisk tankfejl, motorkølevæsketemperatur (ECT) sensorfejl, motorfejl eller tidsforsinkelse, snavset olie, iltsensorfejl, for højt brændstofsystemtryk osv. ."
