		"des": "Transmissionskontrolsystem (MIL-anmodning)",
		"sys": "Gearkasse",
		"zs": "Transmissionskontrolmodulet (TCM eller TCU) hjælper transmissionen med at beslutte, hvornår og hvordan den skal skifte gear ved at indsamle information fra forskellige sensorer og motorkontrolmodulet for at forbedre bilens ydeevne, skifte jævnt og spare brændstofforbrug. Fejlindikatorlys (MIL) kaldes også Check Engine Light. Dens funktion er at lyse et gult eller rødt motorsymbol på instrumentpanelet, når kontrolmodulet registrerer en fejl. Fejlkoden angiver, at drivaggregatet (ECU) har modtaget til en anmodning fra transmissionskontrolenheden (TCU) om at tænde fejlindikatoren."
