		"zs": "Barometertryksensorens rolle (nogle gange kaldet High Altitude Compensator, HAC) er at sende barometertrykket som et elektrisk signal til det elektroniske kontrolmodul. Barometertrykket varierer med vejr og højde. Jo lavere tryk er , jo slankere luften. Powertrain-kontrolmodulet (PCM) vil korrigere brændstoftilførslen baseret på barometrisk trykværdi for at hjælpe motoren med at opnå det bedste luft-brændstofforhold. Denne fejlkode angiver, at lufttrykssensoren er forbundet til turboen. /supercharger indgang Signalforskellen fra tryksensoren (nedstrøms for gasspjældet) overstiger den kalibrerede værdi (normalt 10,35KPa) i den indstillede tidsperiode (2,5 sekunder)."
