		"zs": "Brændstoftrimning er, når den elektroniske kontrolenhed (ECU) styrer brændstoftilførslen ved at øge eller formindske åbningstiden for injektorerne, så motoren opnår det optimale luft-brændstof-forhold (14,7:1 luft-til-benzin masse) forhold) Luft-til-rampe-forholdet er for rigt til for meget brændstoftilførsel og for magert til for lidt brændstoftilførsel. Hvis brændstoftrimningen når og forbliver på minimumsgrænsen i længere tid end en vis tid, vises denne fejlkode ."
