		"zs": "Knastakslens rolle er at kontrollere åbning og lukning af ventilen. I det variable ventiltimingssystem ændrer den elektroniske knastakselreguleringsventil (eller oliekontrolventil, OCV) olietrykket til knastakseljusteringen (mekanisk) bruges til at justere vinklen på knastakslen for at sikre, at ventilen åbner og lukker på det optimale tidspunkt Fejlårsagerne til P0011 omfatter A indsugnings/venstre/forreste knastaksel timing er ikke indstillet Den er fast, knastakslen sidder mekanisk fast , eller aktuatorventilen sidder fast i åben position."
