		"dm": "P0151",
		"des": "O2 sensorkredsløb lavspænding (bank 2, sensor 1)",
		"sys": "Brændstof eller luft",
		"zs": "Liltsensorens funktion er at måle iltindholdet i motorens udstødningsgas for at korrigere brændstofindsprøjtningsmængden, så motoren kan opnå det bedste luft-brændstofforhold. I OBD-fejlkoden, du vil ofte se antallet af rækker og tal Iltsensor. Række 1 refererer til rækken hvor cylinder 1 er placeret, og den resterende række er række 2. Uanset hvilken række, refererer den første sensor altid til opstrøms iltsensoren (før den katalytiske tank), Den 2. sensor refererer altid til den nedstrøms iltsensor (efter den katalytiske tank). Denne fejlkode opstår, når spændingen af det opvarmede iltsensorsignal forbliver under 156 mV i en bestemt periode. Årsagen til fejl omfatter iltsensorkredsløb, stik, selve iltsensoren, elektroniske styremoduler osv."
