		"zs": "Transmissionskontrolmodulet (TCM eller TCU) hjælper transmissionen med at beslutte, hvornår og hvordan den skal skifte gear ved at indsamle information fra forskellige sensorer og motorkontrolmodulet for at forbedre bilens ydeevne, skifte jævnt og spare brændstofforbrug. Kontrolmodulrelæets rolle er at fortsætte med at opretholde strøm til kontrolmodulet, efter at tændingskontakten er slukket, indtil kontrolmodulet fuldfører nedlukningsprocessen."
