		"des": "Positivt krumtaphusventilationsvarmekontrolkredsløb /åbent",
		"sys": "Køretøjshastighed og tomgangshastighedskontrol",
		"zs": "Funktionen af det positive krumtaphusventilation (PCV) system er at aflede den gennemblæsningsgas i krumtaphuset (slutningen af motorens arbejdsforbrændingsproces, noget uforbrændt blanding lækker fra stempelringene ind i krumtaphuset under høj tryk, Industrien refererer til denne lækage som blow-by-gas) Vakuumet, der genereres af motoren, indføres i indsugningsmanifolden, og derefter vil blow-by-gassen komme ind i cylinderen med frisk luft og blive brændt, hvorved forureningen reduceres og forbedres. motoreffektivitet. Denne fejlkode angiver, at den elektroniske kontrol Enheden (PCV) har registreret en positiv krumtaphusventilationsvarmekredsspænding uden for det normale område."
