		"zs": "Brændstofpumpekredsløbet er opdelt i et hovedkredsløb og et sekundærkredsløb. Hovedkredsløbet er ansvarligt for at styre brændstofpumpen, og brændstofpumperelæet bruger den lave strøm fra den elektroniske styreenhed (ECU) til at styre den elektromagnetiske spole, og derved tænder brændstofpumpens høje strøm. Det sekundære kredsløb refererer til brændstofpumpens monitor (FPM) kredsløb, som er ansvarlig for at overvåge brændstofpumpens kredsløbsfeedback. Fejlårsagerne til P0233 omfatter kredsløbet fra brændstofpumpemonitoren (FPM) til brændstofpumpens relæ, brændstofpumpens relækredsløb, brændstofpumpens relæer, elektroniske kontrolenheder (ECU'er) osv."
