		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Kølerkølevæsketemperaturføleren (vandbeholderen) bruger termistorprincippet til at sende radiatortemperatursignalet til den elektroniske styreenhed (ECU) i form af spænding. Hvis ECU'en registrerer (vandbeholderen) radiatorkølevæsketemperaturen Sensorsignalspændingen er højere end den kalibrerede maksimumværdi, fejlkoden vises."
