		"zs": "Bankesensoren er ansvarlig for at detektere vibrationer når motorhastigheden ændres. Bankesensoren udtrykker så denne vibration i form af en spænding. Når det er nødvendigt, vil det elektroniske styremodul (ECU) forsinke tændingen mv. for at undgå at banke opstår. Hvis denne spænding er under den kalibrerede minimumværdi, vises denne DTC."
