		"zs": "Fartpilotsystemet (CRUISE CONTROL SYSTEM) gør det muligt for føreren automatisk at opretholde køretøjets hastighed uden at træde på speederpedalen. Under selvkontrollen af tændingsmotoren (KOER) vil den elektroniske styreenhed (ECU) ) fandt fartpiloten COAST Der trykkes ikke på (kyst)-tasten. Årsager omfatter fartpilotvælgerkontakt, kredsløb, stik eller elektronisk kontrolenhed (ECU)."
