		"sys": "Brændstof eller luft",
		"zs": "Turboladeren bruger inertimomentum af udstødningsgassen, der udledes fra motoren, til at drive turbinen, som igen driver koaksialhjulet til at sætte tryk på indsugningsluften og derved øge bilens effekt. Ladeluftkøleren ( også kaldet intercooler) ) bruges til at køle den overladede luft fra superchargeren. Efter at luften er passeret gennem superchargeren, stiger trykket, og temperaturen stiger. Den overladede lufttemperatur kan reduceres af supercharger-luftkøleren og derved øge luften tæthed og forøgelse af opladningseffektiviteten for at opnå formålet med at forbedre motoreffekten og reducere emissioner Ladeluftkølerens bypassventils funktion er at omgå en del af luften fra luftkøleren. Denne luft blandes derefter med den luft, der afkøles vha. luftkøleren og gå derefter ind i motoren for at sikre, at indsugningslufttemperaturen er højere end dugtemperaturen. Denne DTC vises, hvis luftkølerens bypass-ventilkontrolkreds svigter."
