		"zs": "En katalysator (også kaldet en katalysator) er en udstødningsrensningsanordning, der bruger en katalysators virkning til at omdanne CO, HC og NOx i udstødningen til gasser, der er uskadelige for den menneskelige krop. Den er generelt placeret før lyddæmperen i udstødningsrøret. Denne DTC angiver en fejl i katalysatorens temperaturfølerkredsløb. Årsager omfatter en funktionsfejl i katalysatorens temperaturføler, kredsløb, stik eller elektronisk styreenhed (ECU)."
