		"zs": "Injektorens funktion er at forstøve brændstoffet, så det opfylder kravene til forbrænding. Arbejdsprincippet er, at når den elektromagnetiske spole aktiveres, genereres der sug, nåleventilen suges op, dysehullet åbnes, og brændstoffet passerer gennem nåleventilhovedet. Det ringformede mellemrum mellem akselnålen og delens dysehul sprøjtes med høj hastighed for at danne en tåge. Den elektroniske styreenhed styrer brændstofindsprøjtningsmængden ved at styre åbningstidsinterval (også kaldet pulsbredden) for injektoren. Hvis den elektroniske styreenhed (ECU) Der er registreret en fejl i det 10. cylinderinjektorkredsløb, vil denne DTC fremkomme."
