	"P0362": {
		"zzs": "Alle bilproducenter",
		"dm": "P0362",
		"des": "Tændingsspole L Primær/Sekundær Kreds",
		"sys": "Tændingssystem",
		"zs": "Tændspolens rolle er at omdanne 12-volts spænding på bilbatteriet til tusinder eller endda titusinder af volt, der kræves til tændrørstænding. Der er to sæt spoler i tændspolen, primær spole og sekundær spole. Primærspolen har tykkere emaljeret tråd har færre vindinger; sekundærspolen bruger tyndere emaljeret tråd, som har relativt flere vindinger. Når primærspolen tændes, genereres et stærkt magnetfelt omkring den, da strømmen stiger, og jernkernen lagrer magnetisk feltenergi; når omskifteren afbryder primærspolens kredsløb, falder primærspolens magnetfelt hurtigt, og der induceres en højspænding i sekundærspolen. Den elektroniske styreenhed (ECU) overvåger løbende hvert tændingshovedkredsløb. Hvis ECU'en ikke modtager et gyldigt tændingsdiagnosemonitor (IDM) pulssignal fra tændingsmodulet (integreret i ECU'en), vil fejlkoden fremkomme. Årsagerne til fejlen omfatter tændingsstart/kørsel kredsløb, tændspolekredsløb, selve tændspolefejl, elektronisk kontrolmodul (PCM eller ECM) fejl osv."
	},
