		"sys": "Drivsystem (producentdefineret)",
		"zs": "Indsugningsmanifoldens luftkontrol (IMAC) er placeret mellem indsugningsmanifolden og topstykket. For at forbedre motorens ydeevne svarer hver cylinder til to indsugningspassager, hvoraf den ene altid er åben, den anden Den ene åbner kun når hastigheden er over en vis værdi (f.eks. 3000RPM). IMAC-udførelsesmotorens rolle er at åbne/lukke ventilklappen på indsugningspassagen i henhold til kommandoen fra den elektroniske kontrolenhed (ECU)."
