		"dm": "P1798",
		"des": "CAN Data Bus, TCU/Instrument Panel - Fejl",
		"sys": "Drivsystem (producentdefineret)",
		"zs": "Controller Area Network (CAN) (CAN eller CAN bus for korte) er en bilkommunikationsprotokol, som er kendetegnet ved at tillade enheder på netværket at kommunikere direkte med hinanden uden behov for værtskontrolkommunikation på netværk Transmission Kontrolmodulet (TCM eller TCU) hjælper transmissionen med at beslutte, hvornår og hvordan den skal skifte gear ved at indsamle information fra forskellige sensorer og motorkontrolmodulet for at forbedre bilens ydeevne, skifte jævnt og spare brændstofforbrug."
