		"des": "Brændstofskinne/systemtryk for højt",
		"sys": "Drivsystem (producentdefineret)",
		"zs": "Brændstoftrykregulatoren bruger en fjederdrevet ventil til at føre overskydende benzin tilbage til tanken, hvorved der opretholdes konstant tryk i brændstofkredsløbet. Brændstoftrykregulatoren har en vakuumledning forbundet til indsugningen. Sørg for tilsvarende benzintryk under forskellige motordriftsforhold (bedømmer motorbelastningen efter graden af vakuum). De fleste bilers brændstoftrykregulatorer er placeret på brændstofforgreningsrøret, men nogle bilers brændstoftryksregulatorer er placeret i brændstoftanken. Brændstoftryksensoren måler brændstoftryk nær injektoren. Den elektroniske kontrolenhed (ECU) bruger dette signal til at justere injektorens pulsbredde og måle mængden af brændstof, der kommer ind i forbrændingskammeret."
