		"dm": "P120C",
		"des": "PCV-systemdiagnoseventil - åbent kredsløb",
		"sys": "Drivsystem (producentdefineret)",
		"zs": "Funktionen af det positive krumtaphusventilation (PCV) system er at aflede den gennemblæsningsgas i krumtaphuset (slutningen af motorens arbejdsforbrændingsproces, noget uforbrændt blanding lækker fra stempelringene ind i krumtaphuset under høj tryk, Denne lækage omtales i industrien som blow-by-gas) indføres i indsugningsmanifolden gennem det vakuum, der genereres ved driften af motoren, og derefter vil blow-by-gassen komme ind i cylinderen med den friske luft og blive brændt, hvilket reducerer forureningen og forbedrer motorens effektivitet."
