		"sys": "Auxiliary input",
		"zs": "Motorkontrolmodulet, også kendt som motorkontrolenheden (nogle indbyggede motorkontrolmoduler og transmissionskontrolmoduler er integreret i et drivlinjekontrolmodul), styrer driften af hele motoren. Dens hovedfunktion er Den optimale brændstofindsprøjtning og motorens tændingstidspunkt. En anden vigtig rolle er den komponent, der er ansvarlig for at overvåge udstødningsemissionskontrollen."
