		"zs": "Knastakslens rolle er at kontrollere åbning og lukning af ventilen. I det variable ventiltimingssystem ændrer den elektroniske knastakselreguleringsventil (eller oliekontrolventil, OCV) Vinklen på knastakslen justeres ved hjælp af olietryk til knastakseljusteringen (mekanisk) for at sikre at ventilen åbner og lukker på det optimale tidspunkt Knastakselpositionssensorens (CMP) rolle er at justere knastakselpositionen (den relative position) overføres til Elektronisk kontrolenhed (ECU) i form af et spændingssignal."
