		"des": "O2-sensorreferencespændingskredsløb lav (bank 2 sensor 1)",
		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Liltsensorens funktion er at måle iltindholdet i motorens udstødningsgas for at korrigere brændstofindsprøjtningsmængden, så motoren kan opnå det bedste luft-brændstofforhold. I OBD-fejlkoden, du vil ofte se antallet af rækker og tal Iltsensor. Række 1 refererer til rækken hvor cylinder 1 er placeret, og den resterende række er række 2. Uanset hvilken række, refererer den første sensor altid til opstrøms iltsensoren (før katalysatorbeholderen), Den anden føler refererer altid til den nedstrøms iltføler (efter katalysatorbeholderen) Denne fejlkode angiver, at den elektroniske styreenhed (ECU) har registreret en fejl i iltfølerens 5 volt referencespændingskredsløb. Årsagen til fejlen omfatter iltsensorens 5 volts referencespændingskredsløb til et bestemt A kortsluttet eller kortsluttet kredsløb af en sensor, et kortsluttet eller åbent kredsløb af en eller flere sensorer, en ECU osv."
