		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Diesel Exhaust Fluid (DEF), også kaldet reduktionsmiddel, er en blanding af 32,5 % urinstof og vand. Når det sprøjtes ind i udstødningen, kan det omdanne nitrogenoxider til harmløst nitrogen og vand. Reduktion Middelniveauet sensoren indeholder fire elektroder i rustfrit stål, hvoraf tre er arrangeret lodret for at give høj-, mellem- og lavniveausignaler. Den fjerde elektrode fungerer som jord. Når reduktionsmiddeltanken er fuld, slukker DEF for alle tre elektroder og jorder Et elektrisk kredsløb mellem elektroder, hvilket indikerer, at tanken er fuld. Elektroderne eksponeres i rækkefølge, efterhånden som DEF gradvist forbruges, og niveauet falder. Det elektroniske kontrolmodul (PCM) beregner niveauet af DEF baseret på disse signaler."
