		"sys": "Emissionskontrol",
		"zs": "Rollen for udstødningsgasrecirkulationssystemet (EGR) er at lede en lille mængde udstødningsgas ind i indsugningsmanifolden, når motoren kører med høj belastning. Tilstedeværelsen af disse udstødningsgasser reducerer temperaturen og trykket på forbrændingskammeret, hvorved udledningen af nitrogenoxidforurening reduceres."
