		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Diesel Exhaust Fluid (DEF), også kaldet reduktionsmiddel, er en blanding af 32,5% urinstof og vand. Når det sprøjtes ind i udstødningen, kan det omdanne nitrogenoxider til harmløst nitrogen og vand. Reduktion Middelpumpen samlingen omfatter en trykpumpe, en tryksensor, en skylleventil, et udløbsfilter og et internt varmeelement. Når tryksensoren af reduktionsmidlet virker, styrer PCM pumpehastigheden gennem pulsbreddemodulation (PCM) og regulerer derved systemtryk for at give feedback. Når PCM'en anmoder om reduktionsmiddelindsprøjtning, åbner reduktionsmiddelinjektoren, og pumpen kører, hvilket giver tryk til den originale trykledning og injektorer og renser luft fra systemet. Når al luft er blevet renset, sprøjtes brændstof ind Pumpen slukker, og pumpen giver et tryk på omkring 500 kPa som forberedelse til reduktionsmiddelinjektionen."
