		"sys": "Tændingssystem",
		"zs": "Tændspolens rolle er at omdanne 12-volts spænding på bilbatteriet til tusinder eller endda titusinder af volt, der kræves til tændrørstænding. Der er to sæt spoler i tændspolen, primær spole og sekundær spole. Primærspolen har tykkere emaljeret tråd har færre vindinger; sekundærspolen bruger tyndere emaljeret tråd, som har relativt flere vindinger. Når primærspolen tændes, genereres et stærkt magnetfelt omkring den, da strømmen stiger, og jernkernen lagrer magnetfeltenergi; når omskifteren åbner det primære spolekredsløb, falder det magnetiske felt af den primære spole hurtigt, og en højspænding induceres i den sekundære spole."
