	"P2190": {
		"zzs": "Alle bilproducenter",
		"dm": "P2190",
		"des": "Systemet er for rigt ved tomgang (bank 2)",
		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Brændstoftrimning er, når den elektroniske kontrolenhed (ECU) styrer brændstoftilførslen ved at øge eller formindske åbningstiden for injektorerne, så motoren opnår det optimale luft-brændstof-forhold (14,7:1 luft-til-benzin masse) forhold). Luft-brændstof-forholdet er for rigt betyder, at brændstoftilførslen er for stor, og luft-brændstofforhold er for magert betyder, at brændstoftilførsel er for lille. Systemet er for rig betyder brændstofvolumen (relativ indsugningsluft) volumen) er for høj. Årsagen til fejlen omfatter indsugningsluftstrømssensoren eller manifold absolut tryk (MAP) sensorfejl, brændstoftryk for højt, brændstoftrykregulatorfejl, injektorfejl, iltsensorfejl, knastakseltimingsfejl, olieoverfyldning , Fejl ved fordampningsemissionssystem, fejl i elektronisk kontrolmodul (PCM eller ECM) osv."
	},
