		"zs": "Brændstofpumpens funktion er at suge brændstoffet ud af brændstoftanken, sætte det under tryk og levere det til brændstofforsyningsrøret og samarbejde med brændstoftrykregulatoren for at etablere et bestemt brændstoftryk."
