		"zs": "I det elektroniske gasreguleringssystem (ETC) er gaspedalens (APP)-sensorens rolle at overføre gaspedalens position til gasreguleringsmodulet i form af et elektrisk signal, som en gasspjældaktuator til at styre gasspjældet Referencegrundlag for ventilåbningen. Årsagerne til fejlen omfatter svigt i gaspedalpositionssensorkredsløbet (APP) eller led, svigt af selve APP-sensoren og svigt af det elektroniske kontrolmodul (PCM eller ECM) osv."
