		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Diesel Exhaust Fluid (DEF), også kaldet reduktionsmiddel, er en blanding af 32,5 % urinstof og vand. Når det sprøjtes ind i udstødningen, kan det omdanne nitrogenoxider til harmløst nitrogen og vand. Reduktion Funktionen af agentvarmeren skal holde reduktionsmidlet i flydende tilstand, når udetemperaturen er meget lav. Når reduktionsmiddeltemperaturføleren registrerer, at temperaturen på dieseludstødningsvæsken (DEF) falder til frysetemperaturen (-11 grader Celsius), drivlinje Kontrolmodulet (PCM) instruerer derefter gløderørskontrolmodulet om at aktivere reduktionsvarmeren."
