		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Liltsensorens funktion er at måle iltindholdet i motorens udstødningsgas for at korrigere brændstofindsprøjtningsmængden, så motoren kan opnå det bedste luft-brændstofforhold. I OBD-fejlkoden, du vil ofte se antallet af rækker og tal Iltsensor. Række 1 refererer til rækken hvor cylinder 1 er placeret, og den resterende række er række 2. Uanset hvilken række, refererer den første sensor altid til opstrøms iltsensoren (før den katalytiske tank), Den 2. sensor refererer altid til den nedstrøms iltsensor (efter den katalytiske tank). Fejlårsager omfatter grundlæggende motorfejl (oliestand for højt, knastakseltidsfejl, cylinderkompression for lav, udstødningslækage før iltsensor), brændstofsystemproblem (fejlet brændstoftrykregulator eller brændstoftryk for højt), iltsensorkredsløbskonnektor eller sig selv osv."
