		"des": "Turbolader Boost Control Position Sensor B Kreds intermitterende/uregelmæssig",
		"sys": "Auxiliary input",
		"zs": "Turboladeren bruger inertimomentumet af udstødningsgassen, der udledes fra motoren, til at skubbe turbinen, og turbinen driver koaksialhjulet for at booste indsugningsluften og derved øge køretøjets kraft. Turbo/superlader-boost regulator Funktionen er, at når ladetrykket når den indstillede værdi, presser lufttrykket wastegate-aktuatoren (pneumatisk mekanisk type) for at omgå en del af udstødningsgassen fra turbinen, hvorved turbinehastigheden reduceres og boostniveauet styres Turboladeren. boost kontrol positionssensor Rollen er at overvåge positionen af wastegate ventilen."
