		"sys": "Computer eller hjælpeudgang",
		"zs": "Formålet med brændstofafspærringsventilen er at afbryde brændstoftilførslen til motoren i tilfælde af en nødsituation (såsom en væltning). Hvis den elektroniske styreenhed (ECU) registrerer, at brændstoffet lukker -off ventil B styrekredsspænding overstiger det kalibrerede maksimale område, vil fejlkoden fremkomme."
