		"sys": "Brændstof-, luft- eller emissionskontrol",
		"zs": "Injektorens funktion er at forstøve brændstoffet, så det opfylder kravene til forbrænding. Arbejdsprincippet er, at når den elektromagnetiske spole aktiveres, genereres der sug, nåleventilen suges op, dysehullet åbnes, og brændstoffet passerer gennem nåleventilhovedet. Det ringformede mellemrum mellem akselnålen og dysehullet sprøjtes med høj hastighed for at danne en tåge. Den elektroniske styreenhed styrer brændstofindsprøjtningsmængden ved at styre åbningstidsintervallet (også kaldet pulsbredden) af injektoren."
