		"zs": "Funktionen af udstødningsgastemperaturføleren er at sende udstødningsgastemperaturen til den elektroniske styreenhed (ECU) i form af et elektrisk signal. Udstødningsgastemperaturen genereret af det korrekte luft-brændstofforhold er højere end udstødningsgastemperaturen genereret af det for rige eller for magre luft-brændstofforhold. Lav lufttemperatur. For høj udstødningstemperatur (>160°C) kan beskadige motoren."
