		"zs": "Momentstyringssystemets funktion er at reducere motorens drejningsmoment ved midlertidigt at lukke brændstofinjektoren eller bremse tændingen under transmissionsskift eller hjulslip for at gøre skiftet mere jævnt og reducere sliddet på drivlinje."
