		"sys": "Tændingssystem",
		"zs": "Driftaggregatets kontrolmodul (PCM) bruger en bankesensor til at registrere vibrationer, når motorhastigheden ændres. Bankesensoren udtrykker derefter denne vibration som en spænding. Det elektroniske kontrolmodul (ECU) vil reagere, når det er nødvendigt Undgå at banke ved forsinkende tænding osv."
