		"zs": "Når temperaturen i dieseludstødningssystemet er høj nok, kan dieselpartikelfilteret (DPF) passivt regenereres (oxiderer kulstofaflejringerne på filteret). Når temperaturen i udstødningssystemet ikke er høj nok, den kan passere Aktiv DPF-regenerering sker ved at indsprøjte en lille mængde brændstof opstrøms for Diesel Oxidation Catalyst (DOC) for at øge udstødningssystemets temperatur. Bemærk, at dette indsprøjtede brændstof ikke brænder i udstødningssystemet."
